import styled from 'styled-components'

import Card from '../stats-card'

function Dashboard (props) {
    return(
        <Row>
            <Card title="Live Streamers:" data="15" />
        </Row>
    );
}

const Row = styled.div`
    width: 100%;

    display: flex;
    justify-content: flex-start;
`;

export default Dashboard;
